import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css"; // Asegúrate de que Bootstrap esté importado

const Register = () => {
  const [formData, setFormData] = useState({
    pnombre: "",
    ubicacion: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    snombre: "",
    papellido: "",
    sapellido: "",
    usuario: {
      login: "",
      password: "",
    },
  });

  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    const dataToSend = {
      pnombre: formData.pnombre,
      ubicacion: formData.ubicacion,
      identificacion: parseInt(formData.identificacion),
      email: formData.email,
      fechaNacimiento: formData.fechaNacimiento,
      snombre: formData.snombre,
      papellido: formData.papellido,
      sapellido: formData.sapellido,
      usuario: {
        login: formData.usuario.login,
        password: formData.usuario.password,
      },
    };
  
    fetch("http://localhost:9001/Laboratorio1/persona", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(dataToSend),
    })
      .then((response) => {
        if (response.ok) {
          return response.json();
        } else if (response.status === 409) {
          // Aquí deberías manejar el error y mostrar un mensaje
          return response.json().then((data) => {
            throw new Error(data.message || "El correo ya está registrado.");
          });
        } else {
          throw new Error("Error en la solicitud");
        }
      })
      .then((data) => {
        setModalMessage("Guardado exitoso!");
        setShowModal(true);
      })
      .catch((error) => {
        setModalMessage(error.message); // Muestra el mensaje de error
        setShowModal(true);
      });
  };
  
  


  const handleCloseModal = () => {
    setShowModal(false);
    setFormData({
      pnombre: "",
      ubicacion: "",
      identificacion: "",
      email: "",
      fechaNacimiento: "",
      snombre: "",
      papellido: "",
      sapellido: "",
      usuario: {
        login: "",
        password: "",
      },
    });
  };

  return (
    <div className="container mt-5">
      <div className="card">
        <div className="card-header">
          <h2>Agregar Persona</h2>
        </div>
        <div className="card-body">
          <form onSubmit={handleSubmit}>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Primer Nombre:</label>
                <input
                  type="text"
                  name="pnombre"
                  className="form-control"
                  value={formData.pnombre}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Segundo Nombre:</label>
                <input
                  type="text"
                  name="snombre"
                  className="form-control"
                  value={formData.snombre}
                  onChange={handleChange}
                />
              </div>
            </div>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Primer Apellido:</label>
                <input
                  type="text"
                  name="papellido"
                  className="form-control"
                  value={formData.papellido}
                  onChange={handleChange}
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Segundo Apellido:</label>
                <input
                  type="text"
                  name="sapellido"
                  className="form-control"
                  value={formData.sapellido}
                  onChange={handleChange}
                />
              </div>
            </div>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Ubicación:</label>
                <input
                  type="text"
                  name="ubicacion"
                  className="form-control"
                  value={formData.ubicacion}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Identificación:</label>
                <input
                  type="number"
                  name="identificacion"
                  className="form-control"
                  value={formData.identificacion}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Email:</label>
                <input
                  type="email"
                  name="email"
                  className="form-control"
                  value={formData.email}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Fecha de Nacimiento:</label>
                <input
                  type="date"
                  name="fechaNacimiento"
                  className="form-control"
                  value={formData.fechaNacimiento}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
            <h3>Usuario</h3>
            <div className="row mb-3">
              <div className="col-md-6">
                <label className="form-label">Login:</label>
                <input
                  type="text"
                  name="usuario.login"
                  className="form-control"
                  value={formData.usuario.login}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col-md-6">
                <label className="form-label">Password:</label>
                <input
                  type="password"
                  name="usuario.password"
                  className="form-control"
                  value={formData.usuario.password}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>
            <button type="submit" className="btn btn-primary">
              Guardar
            </button>
            <button
              type="button"
              className="btn btn-secondary ms-3" // Aumentamos el margen entre los botones
              onClick={() => window.location.href = '/login'} // Cambia esta ruta si es necesario
            >
              Regresar a Login
            </button>
          </form>
        </div>
      </div>

      {/* Modal para mostrar mensajes */}
      <div className={`modal fade ${showModal ? "show" : ""}`} style={{ display: showModal ? "block" : "none" }} tabIndex="-1" role="dialog">
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title">Estado del Registro</h5>
              <button type="button" className="close" onClick={handleCloseModal}>
                <span>&times;</span>
              </button>
            </div>
            <div className="modal-body">
              <p>{modalMessage}</p>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                Cerrar
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
